export const Show_number = () => {
    let val = '';
    let ref = createRef();
    const sendInfo = () =>{
        console.log("tap")
        changeUrl(val);
        ref.current.value ='';
        return <Redirect to={"/show"}/>
    }
    const seeValue = (e) =>{
        val = e.target.value;
    }

    return (
        <div className='Car_app'>
            <input type="text" name='x' placeholder='type a number' ref={ref} onChange={seeValue}/>
            <button onClick={()=> sendInfo()}>Check</button>
        </div>
    );
}
